//import { Person } from "@material-ui/icons";
//import { SwipeableDrawer } from "@material-ui/core";
import React, {useState} from "react";
import TinderCard from "react-tinder-card";
import "./TinderCards.css";

function TinderCards() {
    const [people,setPeople] = useState([
        {
           name:"Elon musk",
           url: "https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Elon_Musk_Royal_Society_%28crop2%29.jpg/1200px-Elon_Musk_Royal_Society_%28crop2%29.jpg",
        },
        {
            name:"Mark Zuckerberg",
            url: "https://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/MarkZuckerberg-crop.jpg/210px-MarkZuckerberg-crop.jpg",
        },
    ]);

    const swiped = (direction, nameToDelete) => {
        console.log("removing: " + nameToDelete);
        //setLastDirection(direction);
    };

    const outOfFrame = (name) =>{
        console.log(name + " left the screen!");
    }

  return (

   <div className="tinderCards">
   <div className="tinderCards__cardContainer">
     {people.map((person) => (
        <TinderCard
         className="swipe"
         key={person.name}
         preventSwipe={["up","down"]}
         onSwipe={(dir) => swiped(dir,person.name)}
         onCardLeftScreen={() => outOfFrame(person.name)}
        >
         <div
         style={{ backgroundImage: `url(${person.url})` }}
         className="card"
         >

         </div>

        </TinderCard>
      ))}
   </div>
  </div>
  );

}


export default TinderCards;
